    [],nt"revision_timestamp": "2016-07-27T23:06:02.373124",nt"name": "series-of-aerial-images-over-bear-river-migratory-bird-refuge-acquired-in-1937",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset includes 40 georeferenced
    images, acquired on September 25th, October 12th-13th, November 10th and December
    1st, 1937 over portions of Bear River Migratory Bird Refuge, in Box Elder County,
    Utah.  This series of images were received from the refuge as large, hard copy black
    and white photos and scanned in the Region 6 Regional Office at 400 dpi on a large-format
    scanner.  The image files naming convention includes the date and frame number contained
    on the hard copy image as well as u201cgeou201d for georeferenced files.   The images
    were georeferenced in using Box Elder County 2014 CIR NAIP images.  The reference
    map can be used to identify locations of the images in relation to the refuge boundary.
    These images provide a valuable look back in time before the major flooding which
    occurred in the early 1980's which the Great Salt Lake covered nearly all of the
    refuge. Flooding conditions remained for 5-6 years. These images allow delineation
    of landscape features and habitats including original infrastructure including levees
    and roads, distribution of emergent vegetation, etc. Change over time estimates
    can be made from these images using current imagery for comparison. These images,
    and others from 1965, are being used by refuge staff to assist in understanding
    and visualizing the historical content of the lands within the refuge and how they
    have changed over the last 80 years.  These images should be used for resource-level
    interpretation only.",nt"license_title": "License Not Specified",nt"extras":
